import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="flex items-center justify-between px-8 py-4 bg-black text-white">
      {/* Left nav links */}
      <div className="flex items-center space-x-8">
        <a href="#projects" className="tracking-[0.3em] text-sm">PROJECTS</a>
        <span className="w-px h-4 bg-gray-700"></span>
        <a href="#services" className="tracking-[0.3em] text-sm">SERVICES</a>
      </div>

      {/* Center logo */}
      <div>
        <img src="/path-to-your-logo.png" alt="Logo" className="h-6 mx-auto" />
      </div>

      {/* Right nav links */}
      <div className="flex items-center space-x-8">
        <a href="#about" className="tracking-[0.3em] text-sm">ABOUT</a>
        <span className="w-px h-4 bg-gray-700"></span>
        <a href="#contact" className="tracking-[0.3em] text-sm">CONTACT</a>
      </div>
    </nav>
  );
}
